import {SiAdobexd} from 'react-icons/si'
import {RiReactjsLine} from 'react-icons/ri'
import {FaServer} from 'react-icons/fa'
import {AiFillAppstore} from 'react-icons/ai'


const data = [
    {
        id: 1, icon: <SiAdobexd/>, title: 'Big Data Developer', desc: "Big Data Tools and Eco-system: Hadoop HDFS, Hive, MapReduce, Scoop, Pig, HBase, Yarn, Zookeeper, Oozie"
    },
    {
        id: 2, icon: <RiReactjsLine/>, title: 'Cloud Data Engineer', desc: "Cloud Data Technologies: AWS(S3, EMR, ES, EC2, Athena, Kinesis, Glue, Redshift), Databrics, PySpark, Scala Spark, Azure (Synapse, HDInsight, Blob, Dataproc)"
    },
    {
        id: 3, icon: <FaServer/>, title: 'Data Warehousing', desc: "The security of your business/product is taken seriously right from the start of the project. I will make sure your website/app is secure from attacks."
    },
    {
        id: 4, icon: <AiFillAppstore/>, title: 'Data Streaming', desc: 'Unlike other developers in the market, I will building an app that runs on both IOS and Android devices without any extra cost to you.'
    }
]


export default data
